INSERT INTO `about` (`id`, `about`, `created_at`, `updated_at`) VALUES
(15,	'<h2><span style=\"font-size:18px\"><span style=\"color:#e74c3c\"><strong>By Using Yo App Store</strong> </span></span><span style=\"font-size:14px\">&nbsp;</span></h2>\r\n\r\n<h2><span style=\"font-size:14px\">Create an App for Your Business in Just <span style=\"color:#e74c3c\"><strong>1 Day</strong></span>.<br />\r\nThis is the demo app how&#39;s your application look like after launching on play store.</span><br />\r\n<br />\r\n<span style=\"font-size:18px\"><span style=\"color:#e74c3c\"><strong>Benefit&#39;s with your own App you can</strong></span></span><br />\r\n<br />\r\n<span style=\"font-size:14px\">* Have your own mobile App - Available on your customers Mobile home screen<br />\r\n* Offer Exclusive Deals - Your customers can purchase right from your App<br />\r\n* Send Push Notification - Instant notifications that pop-up Even when your App is not running<br />\r\n* Chat with your customers - Win more loyal customers with a personal touch<br />\r\n* Cash back - Give back some money to your loyal customers so they will come back and buy more<br />\r\n* Sell Globally - Be able to sell anywhere across the globe if you choose to</span></h2>\r\n\r\n<h2><span style=\"font-size:18px\"><span style=\"color:#e74c3c\"><strong>Current Features :</strong></span></span><br />\r\n<br />\r\n<span style=\"font-size:14px\">*Customized Banners/Theme Color Changed<br />\r\n*Product Category<br />\r\n*Item With Multiple Images And Size<br />\r\n*Hot Deals Section<br />\r\n*GPS Location For Order Delivery<br />\r\n*Delivery Charges According To Distance<br />\r\n*Order Tracking<br />\r\n*Push Notification<br />\r\n*Admin Panel With Different User Rights<br />\r\n*Payment Gateway(Optional/Chargeable)</span><br />\r\n<br />\r\n<span style=\"font-size:18px\"><span style=\"color:#e74c3c\"><strong>Get your amazing App right now!</strong></span></span></h2>',	'2020-04-30 20:09:50',	'0000-00-00 00:00:00');
