(8,	'<p><span style=\"color:#e74c3c\"><span style=\"font-size:16px\"><strong>INTERNET BANKING :</strong></span></span></p>\r\n\r\n<p><span style=\"font-size:16px\"><strong>A/c. Name : ISOFTZONE<br />\r\nBank Name : ICICI BANK&nbsp;<br />\r\nA/c.&nbsp;No. : 094505000702<br />\r\nA/c. Type : Current<br />\r\nIFS&nbsp;Code : ICIC0000945<br />\r\nBranch : Rajwada, Indore.</strong></span></p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"color:#e74c3c\">UPI ID&nbsp; :</span>&nbsp; &nbsp;9039095390@icici</span></strong></p>\r\n\r\n<p><strong><span style=\"font-size:16px\"><span style=\"color:#e74c3c\">PAYTM :</span>&nbsp; &nbsp; 7415664456</span></strong></p>\r\n\r\n<p><img alt=\"\" src=\"http://yoappstore.com/login/asset/uploads/ISOFT QR CODE.jpeg\" style=\"height:500px; width:362px\" /></p>\r\n\r\n<p><img alt=\"\" src=\"http://yoappstore.com/login/asset/uploads/qr[1].jpg\" style=\"height:500px; width:330px\" /></p>',	'2020-08-21 23:27:47',	'0000-00-00 00:00:00');
INSERT INTO `privacy_policy` (`id`, `privacy_policy`, `created_at`, `updated_at`) VALUES
(1,	'<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">i-SOFTZONE will inform an&nbsp;individual of&nbsp;the&nbsp;purpose for&nbsp;which it&nbsp;collects and&nbsp;uses information and&nbsp;the&nbsp;types of&nbsp;non-agent&nbsp;third parties to&nbsp;which i-SOFTZONE discloses or&nbsp;may disclose the&nbsp;information.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Information We&nbsp;Collect</span></span></span></strong></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">If&nbsp;you choose to&nbsp;use the&nbsp;Services, we&nbsp;may require you to&nbsp;provide contact and&nbsp;identity information, billing information, and&nbsp;other personal information as&nbsp;indicated on&nbsp;our user interfaces, including on&nbsp;Isoftzone.com. Once you register on&nbsp;Isoftzone.com, you are no&nbsp;longer anonymous to&nbsp;us.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">We&nbsp;collect and&nbsp;store the&nbsp;following information:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Information you give us, including, contact information, such as&nbsp;your name, company name, address, phone number, email address, and&nbsp;similar contact data;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Access credentials such as&nbsp;passwords, password hints, and&nbsp;similar security information unused for&nbsp;authentication and&nbsp;account access.</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Automatic information, such as&nbsp;computer&nbsp;sign-on&nbsp;data, browser type, browser language, statistics on&nbsp;page views, traffic to&nbsp;and&nbsp;from our user interfaces and&nbsp;ad&nbsp;data. Like many websites, we&nbsp;use identifiers such as&nbsp;&ldquo;cookies&rdquo; and&nbsp;Web beacons to&nbsp;obtain this automatic information.</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Location data, which may be&nbsp;precise or&nbsp;imprecise. Precise location data may be&nbsp;Global Position System (GPS) data and/or data identifying nearby cell towers and&nbsp;Wi-Fi&nbsp;hotspots. Imprecise location data includes, for&nbsp;example, a&nbsp;location derived from your IP&nbsp;address or&nbsp;data that indicates where you are located with less precision, such as&nbsp;at&nbsp;a&nbsp;city or&nbsp;postal code level.</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Discussion board posts and&nbsp;other messages, including your correspondence with us. Our communications will include notices about your account (for example, change in&nbsp;password or&nbsp;payment method, confirmation&nbsp;e-mails&nbsp;and&nbsp;other transactional information) and&nbsp;information concerning or&nbsp;related to&nbsp;our service. These communications are part of&nbsp;your relationship with i-SOFTZONE and&nbsp;you receive them as&nbsp;part of&nbsp;the&nbsp;I-SOFTZONE membership. If&nbsp;you or&nbsp;your store&rsquo;s customers do&nbsp;not want to&nbsp;receive our emailed newsletters, other promotional announcements or&nbsp;non-transactional&nbsp;communications, simply use your account name and&nbsp;password to&nbsp;access the&nbsp;control panel on&nbsp;Isoftzone.com and&nbsp;disable any&nbsp;email notifications sent to&nbsp;you or&nbsp;your customers. Email notifications sent by&nbsp;i-SOFTZONE&rsquo;s community forums can be&nbsp;adjusted or&nbsp;disabled via the&nbsp;community forums control panel. </span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">general information regarding the&nbsp;Services that you have registered to&nbsp;receive; and&nbsp;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Information from&nbsp;third-party&nbsp;providers and&nbsp;services to&nbsp;help i-SOFTZONE provide the&nbsp;Services and&nbsp;to&nbsp;help us&nbsp;understand the&nbsp;use of&nbsp;the&nbsp;Services.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">We&nbsp;do&nbsp;not store the&nbsp;following information in&nbsp;the&nbsp;regular course of&nbsp;our business:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">credit card information.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:13.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Our Use of&nbsp;Your Information</span></span></span></strong></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">We&nbsp;use your personal information to:</span></span></span></span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">provide and&nbsp;improve our the&nbsp;Services;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">resolve disputes, calculate and&nbsp;collect fees, and&nbsp;troubleshoot problems;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">verify users&rsquo; identity and&nbsp;the&nbsp;information users provide;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">encourage a&nbsp;safe online experience and&nbsp;enforce our policies;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">customize users&rsquo; experience, analyze site usage, improve and&nbsp;measure interest in&nbsp;the&nbsp;Services, and&nbsp;inform users about other services and&nbsp;updates;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">communicate administrative announcements when we&nbsp;need to&nbsp;provide users with information that may affect their use of&nbsp;the&nbsp;Services;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">communicate marketing and&nbsp;promotional offers and&nbsp;events to&nbsp;our users;</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">provide customer service; and</span></span></span></span></span></span></li>\r\n	<li><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">perform other business activities as&nbsp;described when we&nbsp;collect the&nbsp;information.</span></span></span></span></span></span></li>\r\n</ul>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">As&nbsp;part of&nbsp;your registration on&nbsp;our website to&nbsp;use the&nbsp;Services, our website, you agree that you may receive certain administrative communications from us, such as&nbsp;administrative announcements and&nbsp;customer service messages regarding Services and&nbsp;products during the&nbsp;period that we&nbsp;provide Services to&nbsp;you. You may not opt out of&nbsp;receiving such administrative communications.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">i-SOFTZONE&rsquo;s user interfaces use credit card information solely to&nbsp;check the&nbsp;financial qualifications of&nbsp;prospective customers and&nbsp;to&nbsp;collect payment for&nbsp;the&nbsp;Services.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">Our website also uses automatic information obtained through cookies and&nbsp;Web beacons to&nbsp;operate and&nbsp;improve. We&nbsp;may also use automatic information alone or&nbsp;in&nbsp;combination with personal information about our customers to&nbsp;provide personalized information about isoftzone.com</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\"><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:9.0pt\"><span style=\"font-family:&quot;Open Sans&quot;,&quot;sans-serif&quot;\"><span style=\"color:#333333\">i-SOFTZONE contracts with&nbsp;third-party&nbsp;advertising networks who collect IP&nbsp;addresses and&nbsp;other identifiers on&nbsp;our websites and&nbsp;emails and&nbsp;on&nbsp;third-party&nbsp;websites. Ad&nbsp;networks follow your online activities over time by&nbsp;collecting information through automated means, including through the&nbsp;use of&nbsp;cookies. They use this information to&nbsp;provide advertisements about&nbsp;third-party&nbsp;products and&nbsp;services tailored to&nbsp;your interests. You may see these advertisements on&nbsp;other websites. This process also helps us&nbsp;manage and&nbsp;track the&nbsp;effectiveness of&nbsp;our marketing efforts. I-SOFTZONE, however, does not grant third parties access to&nbsp;any&nbsp;personal information.</span></span></span></span></span></span></p>\r\n\r\n<p style=\"margin-left:0in; margin-right:0in\">&nbsp;</p>',	'2020-04-30 21:18:09',	'0000-00-00 00:00:00');
